import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBriefcase, faEnvelope, faLock } from '@fortawesome/free-solid-svg-icons';
import { FC } from 'react';
import Button from '../Button/Button';
import './_Login.scss';

const Login: FC = () => {
    const handleOnSubmit = () => {
        console.log('submit');
    }

    return (
        <div className='login-container'>
            <div className='login-container-left'>

            </div>
            <form method='POST' onSubmit={handleOnSubmit} className='login-container-right'>
                <h2>Prisijungimas</h2>
                <div className='form-input-container'>
                    <input placeholder='El. Paštas' className='form-input'/>
                    <span className='form-input-icon'>
                        <FontAwesomeIcon icon={faEnvelope}/>
                    </span>
                </div>
                <div className='form-input-container'>
                    <input placeholder='Slaptažodis' className='form-input' />
                    <span className='form-input-icon'>
                        <FontAwesomeIcon icon={faLock}/>
                    </span>
                </div>
                <Button styling='form-button'>
                    Prisijungti
                </Button>

                <div className='forgot-logins-container'>
                    <span className='forgot-logins-container-text'>
                        Pamiršote
                    </span>
                    <Button styling='forgot-logins-container-link' href='/'>
                        prisijungimo varda ar slaptažodi?
                    </Button>
                </div>
            </form>
        </div>
    )
}

export default Login;
